function UpdateInfo(){const o=$("#PersonalForm").serializeArray();console.log(o),$.ajax({url:"/api/Account/UpdatePersonalInfo",type:"PUT",data:o,success:function(o){console.log(o),prepareToast("CheckCircle.svg","Information Updated","Your personal information has been updated successfully.")},error:function(o){console.log(o),prepareToast("xmark.svg","Error",o.responseText)}})}onsubmit=function(o){switch(o.preventDefault(),o.submitter.id){case"PersonalInfo":UpdateInfo()}};